import React from 'react';
import axios from "axios";
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';


class WeatherDetails extends React.Component {

  apiKey = 'xJ4I5DWKpOU1XHmK1ZrDmIkgfffyLX3s';
  default_location = 215854;
  state = { weatherData: '' };




  render() {
    console.log("Weather details");
    return (
      <div>
        <FormControl onSubmit={() => this.requestWeatherDetails(this.getCityList(document.getElementById('loc_input').value))} fullWidth >
          <InputLabel>Location</InputLabel>
          <Input id="loc_input" onChange={() => this.getCityList(document.getElementById('loc_input').value)} />
        </FormControl>
      </div>
    );
  }
}

export default WeatherDetails;
